(990, '78', '94', '', '', '', '', '', '', '0000-00-00', 'Base plus:  Chargé(e) de production informatique H/F', '', '', 'Madame', 'Description :\r\nPoste basé à Strasbourg (67) à pourvoir rapidement en CDI\r\nSSII spécialisée dans le traitement des bases de données marketing.\r\n<BR>\r\nInterlocuteur privilégié du client vous êtes en charge du traitement complet de son dossier, depuis la réception des données jusqu''à la livraison.\r\n<BR>\r\nMissions principales :\r\n<BR>- Suivi et validation des réceptions des fichiers informatiques\r\n<BR>- Traitement informatique de la prestation à effectuer pour le client\r\nPour ce faire, Une formation complète à nos outils informatiques est assurée.\r\n<BR><BR>\r\nProfil :\r\nIssu d''une formation type informatique de gestion, bac+2 ou +3, vous êtes motivé(e), méthodique, rigoureux (se) et possédez le sens du service client.\r\n<BR>Votre aisance relationnelle vous permet de vous intégrer facilement dans une équipe jeune et dynamique. La maîtrise du langage SQL constituerait un plus.\r\nDébutant accepté, allemand souhaité.\r\n\r\nSalaire et avantages :\r\nSalaire avantageux à négocier selon expérience.. Tickets restaurant + Mutuelle\r\n', 'Buchheit', 'Fabienne', '', '', '13 rue Jacobi Netter', '', '67200', 'STRASBOURG', '', '', '03 88 40 86 28', '06 86 26 19 77', '03 88 40 85 56', 'fabienne.buchheit@base-plus.fr', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(991, '1', '94', '', '', '', '', '', '', '0000-00-00', 'ISS HYGIENNE ET PRÉVENTION', '', '', 'Monsieur', 'Description :\r\nNous sommes à la recherche d''un agent de planification (H/F).\r\nVous devrez assurer et optimiser la planification des interventions en collaboration avec l''exploitation et le service commercial afin d''assurer la réalisation des chantiers en garantissant la satisfaction client et l''optimisation des coûts de production.\r\nFormation en logistique et planification exigée (BAC+2)\r\nsalaire à convenir selon profil\r\n35heures hebdo\r\nmutuelle + prime de fin d''année\r\n\r\n\r\n', 'ANTONI', 'Jean-François', '', '', '', '', '', '', '', '', '', '', '', 'jean-francois.antoni@fr.issworld.com', '', 'http://www.fr.issworld.com/fr-FR/nos-services/hygiene-prevention', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(992, '81', '94', '', '11', '', '', '', '', '0000-00-00', 'Comfort Hotel Expo', '', '', 'Madame, Monsieur', '-1 employé(e) polyvalent(e) homme ou femme buffet\r\npetit-déjeuner temps partiel (30h/sem).\r\n\r\nExpérience minimum de 1 an demandée pour ce poste.\r\n\r\n', '', '', '', '', '2 c rue Timken', '', '68000', 'Colmar', '', '', '03 89 300 600', '', '03 89 21 13 59', 'direction@comfort-colmar.com', '', 'http://www.comfort-colmar.com/', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(993, '80', '94', '', 'interim', '', '', '', '', '0000-00-00', 'Ranstad', '', '', 'Monsieur', 'Description :\r\nL''agence Randstad de Sélestat, partenaire des entreprises du Centre-Alsace, recrute UN PLANIFICATEUR DE PRODUCTION BILINGUE (F/H) dans le cadre d''un CDI pour un de ses clients.\r\n\r\nPartie d''Alsace il y a un peu moins d''un siècle, c''est aujourd''hui sur la scène internationale que je joue l''histoire de notre client, spécialisé dans la fabrication d''appareillages électriques basse tension et d''onduleurs de puissance. Avec une présence dans plus de 70 pays, un effectif de 3 000 salariés et un chiffre d''affaires de 441 millions d''euros en constante progression, il recrute PLANIFICATEUR DE PRODUCTION BILINGUE (F/H) en CDI pour accompagner sa croissance.\r\n\r\nAu sein du service supplay chain, et en collaboration avec les approvisionneurs, le service commercial et la production, vous établissez le planning des différentes lignes de fabrication en prenant en compte les contraintes et les impératifs de l''ensemble de ces services (disponibilité matières premières, délai d''approvisionnement, urgence des commandes...) pour assurer de manière optimale l''activité industrielle du site et garantir le respect des délais de livraison chez les clients finaux. Dans ce cadre, vous pourrez, en cas de besoin, intervenir vous-même en soutien sur la partie approvisionnement.\r\n\r\nDe formation bac + 2 en gestion de production industrielle ou logistique, vous bénéficiez d''une expérience similaire d''au moins 3 ans acquise en industrie et possédez un niveau courant d''anglais. Outre la maîtrise des outils de planification et la pratique d''Excel, l''aspect central de votre poste nécessitera de votre part rigueur, polyvalence, réactivité et un bon sens relationnel.\r\nEn contrepartie, notre client saura valoriser votre expertise par une rémunération attractive et négociable, associée à différentes primes et avantages sociaux.\r\n', 'Delorme', 'Georges', '', '', '', '', '', 'Benfeld', '', '', '', '', '', 'georges.delorme@randstad.fr', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(994, '80', '94', '', 'interim', '', '', '', '', '0000-00-00', 'Gezim', '', '', 'Madame', 'REDACTEUR TECHNIQUE H/F\r\n\r\nVous prenez en charge l''ensemble de la rédaction des documents techniques et assurez le suivi documentaire des produits, vos missions :\r\n\r\n- Analyse technique des documents existants et réalisation de la documentation relative à l''utilisation de nos machines ou de nos lignes,\r\n- Rédaction des procédures de maintenance préventive et curative de nos machines et de nos lignes,\r\n- Modification de plans et insertion dans la documentation technique,\r\n- Réalisation de catalogue de pièces détachées pour chaque machine envoyée chez un client\r\n\r\nIssus d''une formation de type BAC à BAC + 2 en mécanique ou en dessin industriel.\r\nIl est nécessaire d''être parfaitement à l''aise dans la lecture de plan mécanique et/ou électrique. Une première expérience significative relative à la rédaction de documents techniques serait un plus.\r\n\r\nLa maitrise de Solidworks et des logiciels WORD et EXCEL est indispensable.\r\nVous pratiquez d''une langue étrangère (anglais, allemand ou espagnol) est souhaité.\r\n\r\nVos qualités relationnelles, votre sens de l''écoute, et votre esprit d''équipe contribueront à la réussite de ce projet.\r\n\r\n\r\nPoste à pourvoir dès que possible, en CDI, salaire négociable en fonction de votre parcours et expertise + avantages groupe industriel.\r\n\r\n\r\nRémunération sur 13 mois, déplacement, participation, intéressement, plan d''épargne retraite.\r\n\r\nVous correspondez au profil et êtes intéressé ? Merci d''adresser votre candidature par mail avec référence en objet : REDAC/TECH/FS', 'FERTOUL ', 'Sofia', '', '', '', '', '', 'Molsheim', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
