(1032, '72', '113', '', '', '', '', '', '', '0000-00-00', '207CC 1.6 HDI 110 FELINE GPS 65000km', '', '', 'Monsieur', 'Étant muté en Nouvelle Calédonie en Janvier 2015, je me sépare de ma 207Cc a contre coeur.\r\nEn excellent état intérieur comme extérieur, elle vous fera a tous les coups succomber.\r\nVeuillez trouver ci dessous les caractéristiques techniques et équipements de la voiture. Il s''agit du haut de gamme en terme d''options.\r\nLe contrôle technique est a jour (fait en juillet 2014)\r\nJe m''en sépare pour 10 450 euros, prix ferme.\r\nN''hésitez pas à m''appeler tous les jours a partir de 17h30.\r\nNon sérieux s''abstenir, pas de Sms\r\nCordialement\r\n\r\nInformations générales\r\nVersion : 207CC 1.6 HDI 110 FELINE GPS\r\nAnnée : 2009\r\nKilométrage : 65000 km\r\nNombre de portes : 2 portes\r\nPuissance fiscale : 6 CV\r\nBoîte de vitesse : mécanique\r\nÉnergie : Diesel\r\nCouleur int. : cuir noir obsidien\r\nCouleur ext. : non\r\nPremière main : non\r\n\r\nOptions & équipements\r\nExtérieur et Châssis\r\n- aide parking\r\n- jantes alu 17"\r\n- phares directionnels\r\n- radar de recul\r\n- rétroviseurs rabattables\r\n- rétroviseurs électriques et dégivrants\r\n- sorties d''échappement chromées\r\n\r\nIntérieur\r\n- 4 vitres électriques\r\n- CD MP3 + Prise aux\r\n- climatisation automatique bi-zone\r\n- GPS 16/9\r\n- intérieur tout cuir\r\n- ordinateur de bord\r\n- pédalier alu\r\n- régulateur de vitesse\r\n- rétroviseur int. jour/nuit auto\r\n- système audio CD\r\n- système audio CD MP3\r\n- tapis de sol\r\n\r\nSécurité\r\n- contrôle de pression des pneus\r\n- détecteur de pluie\r\n- ESP\r\n- essuie-glaces automatiques\r\n- kit téléphone main libre bluetooth\r\n- projecteurs antibrouillard\r\n- répartiteur de freinage\r\n\r\nAntivol\r\n- alarme\r\n- boulons antivol de roues\r\n\r\nAutre :\r\n- carnet de bord\r\n- factures d''entretien ', 'Christin', '', '10450 €', '', '', '', '67000', 'STRASBOURG', '', '', '', '0632428138', '', '', '', 'http://www.lebo