(1042, '46', '67', '', '', '', '', '', '', '0000-00-00', 'Loïc Laubriat', 'Candidature', '', 'Monsieur', 'Bonjour,\r\n\r\nJe me permet de vous contacter suite à l''offre d''emploi que vous avez déposé sur le site de Pôle Emploi. Cette offre est la numéro 020WZSX et correspond à un poste de développeur web.\r\n\r\nJe vous joins en pièces jointes mon CV et ma lettre de motivation.\r\n\r\nDans l''attente d''une réponse favorable de votre part, je vous prie d''agréer, Madame mes respectueuses salutations.\r\n\r\nCordialement,\r\n\r\nLoïc Laubriat', 'Laubriat', 'Loïc', '', '', '', '', '67200', 'STRASBOURG', '', '', '', '0689657908', '', 'laubriat.loic@gmail.com', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1043, '46', '67', '', '', '', '', '', '', '0000-00-00', 'RÉFORMATSKY Anthony', 'Candidature', '', 'Monsieur', 'Madame,\r\n\r\nJ''ai pris connaissance de votre offre d''emploi numéroté 020WZSX au sein de Pôle-\r\nEmploi pour un poste de développeur web.\r\n\r\nCelle-ci restant toutefois assez vague quant aux outils ( frontend/backend - Frameworks\r\n - CMS, etc ) ainsi qu''aux travaux à accomplir, je souhaiterais donc obtenir de plus amples\r\n renseignements sur ces points avant de vous faire part officiellement de ma candidature.\r\n\r\nVeuillez trouver ci-joint mon CV ainsi qu''une lettre de motivation, afin d''en apprendre\r\nun peu plus sur moi et mes compétences.\r\n\r\nJe n''ai peut-être pas l''expérience requise, mais s''il le faut, je suis prêt à m’investir.\r\n\r\n\r\nJe me tiens à votre disposition pour toute information complémentaire.\r\n\r\nEn vous remerciant d’avance, je vous prie d’agréer, Madame, mes respectueuses salutations. \r\n\r\nCordialement,\r\n\r\nRÉFORMATSKY Anthony\r\nanthony@reformatsky.fr', 'RÉFORMATSKY', 'Anthony', '', '', '2 avenue de la gare ', '', '67120', 'MOLSHEIM', '', '', '', '0679110725', '', 'anthony@reformatsky.fr', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
