(1050, '1', '112', '', '11', '', 'autres prestations', '', '', '0000-00-00', 'Golden Tulip', 'Distributeurs', 'Hotel', 'Monsieur', '020RFHQ: info@goldentulipmulhousebasel.com\r\n<BR>\r\nVous êtes réceptionniste confirmé(e) avec 1 à 2 ans d''expérience dans le métier\r\n-le poste à pourvoir est tournant, principalement le soir et de nuit, 25H par semaine avec connaissance du service en bar et restauration.\r\n\r\nVous serez garant(e) du bon déroulement du séjour des clients et veillerez en permanence à leur confort et à leur bien-être.\r\nVous assurerez les différentes prestations offertes aux clients (accueil, check-in/ check-out, prise de réservation, petits déjeuners...).\r\nVous pourez être amené(e) à traiter des objections et réclamations de la clientèle.\r\nVous serez chargé(e) de la facturation et de l''encaissement des recettes, assurez le contrôle de la caisse et veillez à la sécurité pérenne du matériel, des biens et des personnes au sein de l''hôtel.\r\nVous assurerez le room.', 'MUNOZ', 'MATHIAS', 'Gérant Propriétaire', '', 'RD 201 - Rue des Cevennes', 'Ile Napoléon', '68390 ', 'SAUSHEIM', '', '', '0389618840', '', '0389618840', 'gm@goldentulipmulhousebasel.com', '', 'http://www.goldentulipmulhousebasel.com/', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
